import { Tooltip } from '@chakra-ui/react';
import * as d3 from 'd3';

interface GraphLineProps {
  width: number;
  height: number;
  data: { donation: number; additionalMatch: number }[];
  donationAmount: number;
}

export const BonkLine: React.FC<GraphLineProps> = ({
  width,
  height,
  data,
  donationAmount,
}) => {
  const margin = {
    top: 10,
    left: 5,
    bottom: 0,
    right: 5,
  };
  const xScale = d3
    .scaleLinear() // @ts-ignore
    .domain(d3.extent(data.map((d) => d.donation)))
    .range([margin.left, width - margin.right]);

  const yScale = d3
    .scaleLinear() // @ts-ignore
    .domain(d3.extent(data.map((d) => d.additionalMatch)))
    .range([height - margin.bottom, margin.top]);

  // @ts-ignore
  const line = d3
    .line() // @ts-ignore
    .x((d) => xScale(d.donation)) // @ts-ignore
    .y((d) => yScale(d.additionalMatch));

  // @ts-ignore
  const dPath = line(data);

  const markerX = xScale(donationAmount);
  const markerY = yScale(
    // @ts-ignore
    data.find((d) => Math.abs(d.donation - donationAmount) < 0.1)
      .additionalMatch
  );

  return (
    <>
      <line
        x1={markerX}
        x2={markerX}
        y1={markerY}
        y2={height}
        stroke="#636666"
        strokeDasharray="3"
        strokeWidth="0.5"
      />
      <path d={dPath} fill="none" stroke="#DF9D33" stroke-width="2" />
      <Tooltip
        isOpen={true}
        background={'transparent'}
        label={`$${donationAmount}`}
        color="#fff"
        fontWeight={'700'}
        fontSize="16px"
        //textShadow="0 0 0 #fff"
        placement="left"
      >
        <svg
          x={markerX - 5}
          y={markerY - 5}
          width="10"
          height="10"
          viewBox="0 0 10 10"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
          xmlnsXlink="http://www.w3.org/1999/xlink"
        >
          <rect width="10" height="10" rx="5" fill="url(#pattern0)" />
          <defs>
            <pattern
              id="pattern0"
              patternContentUnits="objectBoundingBox"
              width="1"
              height="1"
            >
              <use
                xlinkHref="#image0_793_9409"
                transform="translate(-0.373353 -0.00207737) scale(0.00138889)"
              />
            </pattern>
            <image
              id="image0_793_9409"
              width="1280"
              height="720"
              xlinkHref="data:image/png;base64,"
            />
          </defs>
        </svg>
      </Tooltip>
    </>
  );
};
